async () => {
  let DataLicense = [];
  await API_GET_AuthorizeMatrix.run();
  await storeValue('Data_API_License_NTBX', API_GET_AuthorizeMatrix.data);
  await storeValue('Authorize_Data_API_Authorize_Matrix', undefined);
  for (let i = 0; i < API_GET_AuthorizeMatrix.data.length; i++) {
    let objectLicense = {};
    objectLicense['id'] = API_GET_AuthorizeMatrix.data[i].id;
    objectLicense['version'] = API_GET_AuthorizeMatrix.data[i].version_id;
    objectLicense['position'] = API_GET_AuthorizeMatrix.data[i].Position;
    objectLicense['division'] = API_GET_AuthorizeMatrix.data[i].Division;
    _.forOwn(API_GET_AuthorizeMatrix.data[i].License, (value, key) => {
      objectLicense[key] = value;
    });
    DataLicense?.push(objectLicense);
  }
  storeValue('Authorize_Data_API_Authorize_Matrix', _.unionBy(DataLicense));
  appsmith.store.Authorize_Data_API_Authorize_Matrix.forEach(item => {
    console.log(item);
  });
}
